import React, {Component} from 'react';

class Category extends Component {
    render() {
        return (
            <div>
                <ul>
                    <li className="items"><a href="" className="links">Lorem ipsum.</a></li>
                    <li className="items"><a href="" className="links">Ducimus, incidunt.</a></li>
                    <li className="items"><a href="" className="links">Dolor, inventore?</a></li>
                    <li className="items"><a href="" className="links">Consectetur, maxime.</a></li>
                    <li className="items"><a href="" className="links">Doloremque, qui.</a></li>
                    <li className="items"><a href="" className="links">Aliquam, odit?</a></li>
                    <li className="items"><a href="" className="links">Accusamus, quisquam.</a></li>
                    <li className="items"><a href="" className="links">Distinctio, quaerat?</a></li>
                    <li className="items"><a href="" className="links">Fugit, labore?</a></li>
                    <li className="items"><a href="" className="links">Dignissimos, expedita.</a></li>
                </ul>
            </div>
        );
    }
}

export default Category;
